import styled from 'styled-components/native'
import * as BaseStyles from '../BaseStyles.js'

export const TopBackgroundDiv = styled(BaseStyles.Container)`
    background: #292929;
    box-sizing: border-box;
    height: 50vh;
    width: 100%;
    position: relative;
    z-index: 0;
`

export const BottomBackgroundDiv = styled(BaseStyles.Div)`
    background: #FFFFFF;
    box-sizing: border-box;
    height: 50vh;
    width: 100%;
    position: relative;
    z-index: 0;
`

